INSERT INTO `promotion` (`pro_id`, `pro_name`, `description`, `pro_startdate`, `pro_enddate`, `pro_img`, `shop_id`, `c_id`) VALUES
(10004, 'งานเสียทรัพย์ต้องมา!! Victoria\'s Secret ซื้อ 2 แถม 1 นาทีนี้ต้องช้อป (วันนี้ - ยังไม่มีกำหนด)', '#PROMOTION งานเสียทรัพย์ต้องมา!! Victoria\'s Secret ซื้อ 2 แถม 1 นาทีนี้ต้องช้อป\r\n\r\nรีบมาจัดกันโดยด่วน ตุนความหอมให้ติดฟุ้งยาวนาน งานนี้จัดโปรโมชั่นซื้อ 2 แถม 1 ไม่ว่าจะเป็น Body Mist, Body Lotion หรือ Velvet Matte Liquid Lipsticks คำนวณแล้วตกราคาชิ้นละไม่กี่บาทเอง บอกเลยว่าคุ้มค่ามาก รีบ Tag เพื่อนหรือสายเปย์ไปช้อปที่สาขา CentralPlaza Pinklao , CentralPlaza WestGate และอีก 6 สาขาในศูนย์การค้าโดยด่วน\r\n\r\n#CPNLIFE #CPNLIVEMAKER #VictoriasSecret #BodyMist#BodyLotion', '2017-11-24', '2099-11-24', , NULL, 4);
INSERT INTO `promotion` (`pro_id`, `pro_name`, `description`, `pro_startdate`, `pro_enddate`, `pro_img`, `shop_id`, `c_id`) VALUES
(10005, 'สิทธิพิเศษเฉพาะลูกค้าผู้ถือบัตร SCB มาทานอาหารที่ร้าน Morimoto จะได้รับสิทธิพิเศษ ลด 10%', 'สิทธิพิเศษเฉพาะลูกค้าผู้ถือบัตร SCB มาทานอาหารที่ร้าน Morimoto จะได้รับสิทธิพิเศษ ลด 10% ค่าอาหารสำหรับบัตรไทยพาณิชย์และสำหรับผู้ถือ\r\nบัตร SCB Platinum จะได้รับส่วนลด 15% เมื่อทานอาหารครบ 5,000บา/เซลล์สลิป วันนี้ ถึง 30 พ.ย. 60', '2017-11-24', '2017-11-30', , NULL, 1);
INSERT INTO `promotion` (`pro_id`, `pro_name`, `description`, `pro_startdate`, `pro_enddate`, `pro_img`, `shop_id`, `c_id`) VALUES
(10006, 'กลับมาอีกครั้ง! แมคข้าวพะแนง อร่อยจัดจ้านถึงใจ เริ่มเพียงจานละ 59 บาท (วันนี้ - ยังไม่มีกำหนด)', 'กลับมาอีกครั้ง! แมคข้าวพะแนง\r\n\r\nอร่อยจัดจ้านถึงใจ เริ่มเพียงจานละ 59 บาท\r\n\r\nหรือจะเลือกอร่อยกับข้าวขี้เมา ก็ฟินสุด!!\r\n\r\nเริ่ม 17 พ.ย. - 28 ธ.ค.​ 60 (หรือจนกว่าสินค้าจะหมด)\r\n\r\nที่แมคโดนัลด์ #แมคข้าวพะแนง#แมคข้าวขี้เมา #จัดจ้านถึงใจ\r\n\r\nสาขาที่ร่วมรายการ bitly.com/mcstores_promotion', '2017-11-17', '2017-12-28', , NULL, 1);
INSERT INTO `promotion` (`pro_id`, `pro_name`, `description`, `pro_startdate`, `pro_enddate`, `pro_img`, `shop_id`, `c_id`) VALUES
(10007, 'งานนี้พลาดไม่ได้แล้ว...Winter Sale!!! หนาวนี้ Mc ให้คุณอุ่น ขนเสื้อ Jacket มาให้อุ่นเพียบ!!! ที่ Shop Mc Jeans ทุกสาขา (วันนี้ - 31 ธ.ค. 2560)', 'Winter Sale!! หนาวนี้ Mc ให้คุณอุ่น!\r\n• Hoodie Jacket 795 บาท (ปกติ 1,795 บาท)\r\n• Light Jacket 1,195 บาท (ปกติ 2,195 บาท)\r\n• Jeans Jacket 1,595 บาท (ปกติ 2,595 บาท)\r\n*เฉพาะสินค้าที่ร่วมรายการ\r\n*ตั้งแต่วันนี้ - 31 ธันวาคม 2560 นี้เท่านั้น!!!\r\nงานนี้พลาดไม่ได้แล้ว...ที่ Shop Mc Jeans ทุกสาขา!!\r\n\r\n*เงื่อนไข \r\n• เฉพาะสินค้ารุ่นที่กำหนดเท่านั้น \r\n• สินค้าที่ร่วมรายการได้แก่ แม็คยีนส์ แม็คเลดี้ เดอะบลูบราเธอร์ส แม็คที อัพ \r\n• สามารถร่วมรายการส่งเสริมการขายนี้ได้ที่ร้านแม็คยีนส์ แม็คเลดี้ แม็ค แม็ค และแม็ค แม็คปตท. ทุกสาขา \r\n• รายการส่งเสริมการขายนี้ สามารถร่วมรายการอื่นได้ตามที่กำหนด \r\n• บริษัทฯ ขอสงวนสิทธิ์ในการยกเลิก แก้ไข หรือเปลี่ยนแปลงเงื่อนไขโดยไม่ต้องแจ้งให้ทราบล่วงหน้า', '2017-11-24', '2017-12-31', , NULL, 4);

